<node CREATED="1724870139009" MODIFIED="1726166031249" TEXT=" TRL 1 - Princ&#xed;pios b&#xe1;sicos observados: nesse est&#xe1;gio, a pesquisa cient&#xed;fica inicial est&#xe1; sendo conduzida, explorando conceitos e fundamentos te&#xf3;ricos.">
<icon BUILTIN="tag_green"/>
</node>
</node>
</node>
<node CREATED="1725469811823" FOLDED="true" ID="ID_679840641" MODIFIED="1725469852665" TEXT="instance">
<icon BUILTIN="element"/>
<node CREATED="1725469816393" FOLDED="true" ID="ID_1684033792" MODIFIED="1725480614120" TEXT="nome">
<icon BUILTIN="element"/>
<node CREATED="1724870139011" MODIFIED="1726166023010" TEXT="TRL 2 - Aplica&#xe7;&#xe3;o da pesquisa: nesse ponto, a pesquisa come&#xe7;a a se transformar em aplica&#xe7;&#xf5;es pr&#xe1;ticas. Os cientistas come&#xe7;am a traduzir a teoria em prot&#xf3;tipos experimentais.">
<icon BUILTIN="tag_green"/>
</node>
</node>
</node>
<node CREATED="1725469811823" FOLDED="true" ID="ID_1129838036" MODIFIED="1725469852665" TEXT="instance">
<icon BUILTIN="element"/>
<node CREATED="1725469816393" FOLDED="true" ID="ID_638093018" MODIFIED="1725480618187" TEXT="nome">
<icon BUILTIN="element"/>
<node CREATED="1724870158349" MODIFIED="1726166014839" TEXT=" TRL 3 - Prova de conceito: nesta fase, a valida&#xe7;&#xe3;o dos conceitos iniciais ocorre por meio de experimentos e prot&#xf3;tipos. O objetivo &#xe9; demonstrar que a ideia te&#xf3;rica pode ser transformada em algo funcional.">
<icon BUILTIN="tag_green"/>
</node>
</node>
</node>
<node CREATED="1725469811823" FOLDED="true" ID="ID_1660778054" MODIFIED="1725469852665" TEXT="instance">
<icon BUILTIN="element"/>
<node CREATED="1725469816393" FOLDED="true" ID="ID_1293961122" MODIFIED="1725480634593" TEXT="nome">
<icon BUILTIN="element"/>
<node CREATED="1724870158351" MODIFIED="1726166008387" TEXT=" TRL 4 - Valida&#xe7;&#xe3;o em ambiente de laborat&#xf3;rio: aqui, a tecnologia passa por testes em ambiente de laborat&#xf3;rio, simulando condi&#xe7;&#xf5;es reais. Os resultados s&#xe3;o analisados para verificar a efic&#xe1;cia e a viabilidade.">
<icon BUILTIN="tag_green"/>
</node>
</node>
</node>
<node CREATED="1725469811823" FOLDED="true" ID="ID_1207376835" MODIFIED="1725469852665" TEXT="instance">
<icon BUILTIN="element"/>
<node CREATED="1725469816393" FOLDED="true" ID="ID_125052645" MODIFIED="1725480636716" TEXT="nome">
<icon BUILTIN="element"/>
<node CREATED="1724870158352" MODIFIED="1726166002683" TEXT=" TRL 5 - Valida&#xe7;&#xe3;o em ambiente relevante: agora, a tecnologia &#xe9; testada em um ambiente relevante, pr&#xf3;ximo ao ambiente de uso pretendido. O objetivo &#xe9; avaliar o desempenho em condi&#xe7;&#xf5;es mais pr&#xf3;ximas da realidade.">
<icon BUILTIN="tag_green"/>
</node>
</node>
</node>
<node CREATED="1725469811823" FOLDED="true" ID="ID_454148778" MODIFIED="1725469852665" TEXT="instance">
<icon BUILTIN="element"/>
<node CREATED="1725469816393" FOLDED="true" ID="ID_331534564" MODIFIED="1725480647534" TEXT="nome">
<icon BUILTIN="element"/>
<node CREATED="1724870158354" MODIFIED="1726165995057" TEXT=" TRL 6 - Demonstra&#xe7;&#xe3;o em ambiente operacional: nesta etapa, a tecnologia &#xe9; implantada e demonstrada em um ambiente operacional real. &#xc9; uma oportunidade de verificar sua efic&#xe1;cia e coletar feedback dos usu&#xe1;rios.">
<icon BUILTIN="tag_green"/>
</node>
</node>
</node>
<node CREATED="1725469811823" FOLDED="true" ID="ID_644877046" MODIFIED="1725469852665" TEXT="instance">
<icon BUILTIN="element"/>
<node CREATED="1725469816393" FOLDED="true" ID="ID_535033724" MODIFIED="1725480650061" TEXT="nome">
<icon BUILTIN="element"/>
<node CREATED="1724870158355" MODIFIED="1726165987240" TEXT="  TRL 7 - Demonstra&#xe7;&#xe3;o em ambiente de prot&#xf3;tipo pr&#xe9;-comercial: nesse est&#xe1;gio, a tecnologia &#xe9; demonstrada em um ambiente operacional relevante, simulando condi&#xe7;&#xf5;es reais de uso. Os resultados s&#xe3;o usados para ajustes finos antes da produ&#xe7;&#xe3;o em larga escala.">
<icon BUILTIN="tag_green"/>
</node>
</node>
</node>
<node CREATED="1725469811823" FOLDED="true" ID="ID_142364226" MODIFIED="1725469852665" TEXT="instance">
<icon BUILTIN="element"/>
<node CREATED="1725469816393" FOLDED="true" ID="ID_1312011468" MODIFIED="1725480651806" TEXT="nome">
<icon BUILTIN="element"/>
<node CREATED="1724870158357" MODIFIED="1726165977719" TEXT=" TRL 8 - Sistema completo validado em ambiente operacional: aqui, o sistema completo &#xe9; validado e operado em um ambiente real, sem fins experimentais. &#xc9; uma fase cr&#xed;tica para garantir que todas as funcionalidades estejam prontas para uso.">
<icon BUILTIN="tag_green"/>
</node>
</node>
</node>
<node CREATED="1725469811823" FOLDED="true" ID="ID_770490336" MODIFIED="1725469852665" TEXT="instance">
<icon BUILTIN="element"/>
