<node CREATED="1725560761016" MODIFIED="1726166213134" TEXT="Ao preencher o presente formul&#xe1;rio de comunica&#xe7;&#xe3;o de invento, todos os inventores declaram estar cientes e concordar com os termos da Resolu&#xe7;&#xe3;o n&#xba; 137/2022-COU que instituiu a Pol&#xed;tica de Inova&#xe7;&#xe3;o e Empreendedorismo da UNIOESTE (PIIE), e da Resolu&#xe7;&#xe3;o n&#xba; 140/2022-COU, que trata do Regulamento de Propriedade Intelectual e Direitos Relacionados da UNIOESTE, bem como das demais normas afetas &#xe0;s mesmas, devendo ser acompanhada da assinatura de todos os envolvidos no projeto.&#xa;&#xa;Nome e Assinatura do Inventor 1&#xa;Nome e Assinatura do Inventor 2&#xa;&#xa;OBS. 1: No caso de mais de 2 (dois) inventores, se faz necess&#xe1;rio a assinatura de todos os demais. Assim, replique o campo de assinaturas.&#xa;OBS. 2: Sugerimos que este formul&#xe1;rio seja salvo em PDF e que as assinaturas sejam feitas de maneira digital, usando o gov.br. (Assinatura Eletr&#xf4;nica &#x2014; Governo Digital (www.gov.br).&#xa;">
